CREATE TABLE `contest` (
  `contest_id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(240) NOT NULL DEFAULT '' COMMENT '比赛名称',
  `type` varchar(20) NOT NULL DEFAULT 'PRACTICE' COMMENT '比赛类型（PRACTICE:训练[无密码，无名单]；CONTEST:比赛[有密码，无名单]；EXAM:考试[无密码，有名单]）',
  `is_need_audit` char(1) DEFAULT 'N' COMMENT '是否需要审批才能参加比赛',
  `problem_count` int(11) DEFAULT '0' COMMENT '比赛的题目数量',
  `start_time` datetime NOT NULL COMMENT '比赛开始时间',
  `end_time` datetime NOT NULL COMMENT '比赛结束时间',
  `user_name` varchar(20) NOT NULL DEFAULT 'root' COMMENT '比赛创建用户名',
  `class_count` int(11) DEFAULT '0' COMMENT '班级数量（EXAM有效）',
  `password` varchar(64) DEFAULT '' COMMENT '比赛密码（CONTEST有效）',
  `notice` text COMMENT '比赛注意事项',
  `significant` text COMMENT '目的与意义（生成试卷）',
  `significant_time` varchar(30) DEFAULT NULL COMMENT '试卷显示时间（生成试卷）',
  `ac_tag1` int(11) NOT NULL DEFAULT '0' COMMENT '至少需要ac分类1的数量才能参加此比赛\n下面以此类推',
  `ac_tag2` int(11) NOT NULL DEFAULT '0',
  `ac_tag3` int(11) NOT NULL DEFAULT '0',
  `ac_tag4` int(11) NOT NULL DEFAULT '0',
  `ac_tag5` int(11) NOT NULL DEFAULT '0',
  `is_deleted` char(1) DEFAULT 'N' COMMENT '比赛是否显示在列表中',
  PRIMARY KEY (`contest_id`)
) ENGINE=MyISAM AUTO_INCREMENT=318 DEFAULT CHARSET=utf8;
